                        writer: writer,
                        item: item.Magnitude_Property,
                        fieldIndex: (int)Effect_FieldIndex.Magnitude,
                        errorMask: errorMask);
                    Mutagen.Bethesda.Binary.UInt32BinaryTranslation.Instance.Write(
                        writer: writer,
                        item: item.Area_Property,
                        fieldIndex: (int)Effect_FieldIndex.Area,
                        errorMask: errorMask);
                    Mutagen.Bethesda.Binary.UInt32BinaryTranslation.Instance.Write(
                        writer: writer,
